import { useState, useEffect } from 'react';

function TodoList({ userId, tokenn }) {
  const [todos, setTodos] = useState([]);
  const [newTodo, setNewTodo] = useState('');
  const [token, setToken] = useState(tokenn);


  useEffect(() => {
    // Fetch todos data from server
    const fetchTodos = async () => {
      try {
        const response = await fetch(`http://localhost:3000/todos?userId=${userId}`, {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        const data = await response.json();
        setTodos(data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchTodos();
  }, [token, userId]);


  const handleAddTodo = async () => {
    const newId = todos.length > 0 ? todos[todos.length - 1].id + 1 : 1;
    const newTodoObj = { id: newId, description: newTodo, userId, status: 'Not done yet' };


    try {
      const response = await fetch('http://localhost:3000/todos', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify(newTodoObj),
      });
      const data = await response.json();
      setTodos([...todos, data]);
      setNewTodo('');
    } catch (error) {
      console.error(error);
    }
  };



  const handleToggleStatus = async (id) => {
    const todoToToggle = todos.find(todo => todo.id === id);
    if (!todoToToggle) {
      console.error('Todo not found');
      return;
    }
    const newStatus = todoToToggle.status === 'Not done yet' ? 'Done' : 'Not done yet';
    const newTodos = todos.map((todo) =>
      todo.id === id ? { ...todo, status: newStatus } : todo
    );
    setTodos(newTodos);
    try {
      await fetch(`http://localhost:3000/todos/${id}`, {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify({ status: newStatus }),
      });
    } catch (error) {
      console.error(error);
    }
  };





  const handleEditTodo = async (id, newDescription) => {
    const todoToEdit = todos.find((todo) => todo.id === id);
    if (!todoToEdit) {
      console.error('Todo not found');
      return;
    }
    const newStatus = todoToEdit.status === 'done' ? 'undone' : 'done';
    const newTodoObj = { ...todoToEdit, description: newDescription, status: newStatus };
    const newTodos = todos.map((todo) => (todo.id === id ? newTodoObj : todo));
    setTodos(newTodos);

    try {
      await fetch(`http://localhost:3000/todos/${id}`, {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify(newTodoObj),
      });
    } catch (error) {
      console.error(error);
    }
  };


  const handleDeleteTodo = async (id) => {
    const newTodos = todos.filter((todo) => todo.id !== id);
    setTodos(newTodos);
    try {
      await fetch(`http://localhost:3000/todos/${id}`, {
        method: 'DELETE',
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });
    } catch (error) {
      console.error(error);
    }
  };


  return (
    <div>
      <h2>Todo List</h2>
      <ul>
        {Array.isArray(todos) && todos.map((todo) => (
          <li key={todo.id}>
            <span style={{ textDecoration: todo.done ? 'line-through' : 'none' }}>{todo.description}</span>
            <button onClick={() => handleDeleteTodo(todo.id)}>Delete</button>
            <button onClick={() => handleEditTodo(todo.id, prompt('Enter new description', todo.description))}>Edit</button>
            <button onClick={() => {
              const newTodos = todos.map((t) => {
                if (t.id === todo.id) {
                  return { ...t, done: !t.done };
                }
                return t;
              });
              setTodos(newTodos);
            }}>{todo.done ? 'Undone' : 'Done'}</button>
          </li>
        ))}
      </ul>
      <div>
        <input type="text" value={newTodo} onChange={(e) => setNewTodo(e.target.value)} />
        <button onClick={handleAddTodo}>Add Todo</button>
      </div>
    </div>
  );


}

export default TodoList;
